INSERT INTO `wp_posts` (`post_author`,`post_date`,`post_date_gmt`,`post_content`,`post_title`,`post_excerpt`,`post_status`,`comment_status`,`ping_status`,`post_password`,`post_name`,`to_ping`,`pinged`,`post_modified`,`post_modified_gmt`,`post_content_filtered`,`post_parent`,`guid`,`menu_order`,`post_type`,`post_mime_type`,`comment_count`) VALUES (1,'2016-03-04 20:20:45','2016-03-04 19:20:45','Nesporno ima alpinizem v Kranju dolgo tradicijo. Po letu 1975, ko je Nejc Zaplotnik preko južne stene dosegel vrh Makaluja, je bilo le malo slovenskih vrhunskih uspehov, kjer ne bi sodelovali kranjski alpinisti. Največje uspehe so dosegli v Himalaji, kjer v zadnjih letih najbolj izstopata Česnova vzpona (Žanu in Lotse) ter Štremfljev vzpon na Južni vrh Kangčendzenge. Oba sta za svoje vzpone dobila mednarodno priznanje za najboljši vzpon leta (\"Snežni lev\" in \"Zlati cepin\"). Česen je poleg tega opravil pomembne vzpone v Centralnih Alpah in Dolomitih, neprekosljiv pa je tudi v kategoriji vseh vrst solo vzponov. Marija Štremfelj je že dolga leta najuspešnejša slovenska alpinistka in edina Slovenka, ki je bila na vrhu dveh osemtisočakov. Srečo Rehberger je bil na vrhuncu svoje plezalne poti najboljši slovenski predstavnik v športnem plezanju.\r\n\r\nAlpinistični odsek trenutno združuje alpiniste in športne plezalce. Prvi so aktivni prav na vseh področjih od ekstremnega smučanja (M. Kranjc) do vodenja alpinističnih odprav (T. Jamnik) in vseh ostalih oblik alpinizma, drugi pa so uspešni tako na tekmovanjih kot pri plezanju v plezališčih.\r\n\r\nPo zelo uspešnih letih je opaziti rahel padec v kvaliteti. Taka nihanja so normalen pojav v vsakem športu. Delo z mladimi, kateremu posvečajo veliko pozornost, pa je najboljše zagotovilo, da bodo kmalu prišli boljši časi.\r\n\r\n<i>Marija Štremfelj</i>','Odsek','','publish','closed','closed','','odsek','','','2016-03-04 21:03:57','2016-03-04 20:03:57','',0,'http://aokranj2.lan/?page_id=20656',1,'page','',0);
INSERT INTO `wp_posts` (`post_author`,`post_date`,`post_date_gmt`,`post_content`,`post_title`,`post_excerpt`,`post_status`,`comment_status`,`ping_status`,`post_password`,`post_name`,`to_ping`,`pinged`,`post_modified`,`post_modified_gmt`,`post_content_filtered`,`post_parent`,`guid`,`menu_order`,`post_type`,`post_mime_type`,`comment_count`) VALUES (1,'2016-03-04 20:26:19','2016-03-04 19:26:19','Človek je neločljivo povezan z naravo, ki mu je osnovni in nenadomestljivi pogoj za življenje. Odlikuje ga sposobnost ustvarjanja, iskanja novega v neznanem, najmanjšem, najbolj zapletenem, neskončno velikem, kjer mu misli in želje omejujeta čas in prostor. Vztrajno išče samega sebe, smisel svojega življenja, pa tudi smisel in resnico o smrti. Področje, kjer poskuša dobiti odgovore na vprašanja, motivacijo za ustvarjanje in potešitev svojih duhovnih potreb, je gotovo alpinizem. Alpinizem je dejavnost, kjer lahko zadovoljimo športne, raziskovalne, romantične, heroične, etične in socialne interese. Alpinizem ima tudi filozofsko plat in mnogi najdejo v njem tisto, kar jim omogoča izpolnitev njihovih upanj, želja in pričakovanj.\r\n\r\nPrav povdarek enemu ali večim zanimanjem pa ima za posledico vrsto aktivnosti v okviru alpinizma:\r\n<ul>\r\n	<li>alpinistični vzponi - zimski</li>\r\n	<li>letni</li>\r\n	<li>odpravarstvo - gorstva izven Evrope</li>\r\n	<li>plezanje zaledenelih slapov</li>\r\n	<li>alpinistično smučanje</li>\r\n	<li>športno plezanje</li>\r\n</ul>\r\nPlezanje, kot osnovni element alpinizma, se pričenja tam, kjer noge same ne zadostujejo za ohranitev ravnotežja in jim morajo priskočiti na pomoč roke. Plezanje zahteva moč in največje napore, vendar moč ni odkočilna. Potrebno je skladno premikanje rok in nog, občutek za ravnotežje, telesno spretnost, iznajdljivost v vsakem položaju in tudi duševno pripravo plezalca.\r\n\r\nProsto plezanje in športno plezanje sta termina, ki povzročata številne nesporazume, ker je njuna uporaba nedosledna. Prosto plezanje, kot način plezanja, obstaja že od prvih začetkov alpinizma. Tehnični pripomački se uporabljajo samo za varovanje, ne pa tudi za napredovanje. V nasprotnem primeru je plezanje tehnično. Številne tehnične smeri v Julijcih, Kamniških Alpah in Paklenici so bile prosto ponovljene potem, ko sta Iztok Tomazin in Borut Bergant prinesla idejo o prostih ponovitvah v tehničnih smereh s plezalne turneje po ZDA 1978. leta.\r\n\r\nPočasi (1985) se je iz prostega plezanja razvil termin športnega plezanja, ki predvsem označuje plezanje v smereh, dolgih do 40 metrov. Špotrno plezanje v prvi vrsti zadovoljuje športne interese in ima zato z alpinizmom kot kompleksno dejavnostjo le še nekaj skupnih točk, predvsem plezanje kot osnovni tehnični element.\r\n\r\nDanes v okviru športnega plezanja že ločimo dve vrsti dejavnosti:\r\n<ul>\r\n	<li>plezanje v naravnih stenah (do 40 m),</li>\r\n	<li>tekmovalno plezanje (na umetnih stenah).</li>\r\n</ul>\r\nPredvsem plezanje v naravnih kratkih stenah je tudi odličen trening za alpiniste, ki v visokih stenah v osrčju gora dvigujejo trend večanja težavnosti. Magična meja težavnosti 6+, kot najtežje, kar je bilo v alpinističnih vzponih mogoče splezati, je že zdavnaj presežena.\r\n\r\nTekmovalno plezanje je tudi pri nas v Sloveniji in v svetu oblikovalo tri osnovne tekmovalne sisteme:\r\n<ul>\r\n	<li>master (vabljeni najboljši plezalci),</li>\r\n	<li>pokali - pionirski pokal Slovenije</li>\r\n	<li>mladinski in članski pokal Slovenije</li>\r\n	<li>svetovni pokal</li>\r\n	<li>prvenstva - državno prvenstvo pionirjev in članov</li>\r\n	<li>prvenstvo kontinentov</li>\r\n	<li>svetovno prvenstvo</li>\r\n</ul>\r\nVsako usmerjeno zanimanje za neko področje ali dejavnost združuje ljudi v skupine, ki se organizirajo v skladu s svojimi željami in potrebami in v skladu z možnostmi v širši družbeni skupnosti.\r\n\r\nAlpinisti Kranja so združeni v Alpinistični odsek (AO), le ta pa deluje pod okriljem matičnega Planinskega društva Kranj. Krovna organizacija je Planinska zveza Slovenije, v okviru katere Komisija za alpinizem bedi nad slovenskim alpinizmom in vzpostavlja stike z alpinističnimi odseki. V letu 1994 je iz Komisije za alpinizem izstopila Podkomisija za športno plezanje in postala samostojna. Kljub temu delujejo v večjem delu Slovenije, tudi v Kranju, alpinisti in športni plezalci skupaj v AO. AO vodi načelnik, ki usmerja delo tako, da se uresničujejo osnovni nameni in naloge:\r\n<ul>\r\n	<li>navajanje k aktivnemu delovanju v naravi, predvsem v gorah</li>\r\n	<li>vzgoja tečajnikov in pripravnikov v alpinistični šoli (AŠ)</li>\r\n	<li>skrb za varstvo planinske narave</li>\r\n	<li>zagotavljanje sredstev za izvajanje porogramov vrhunskih alpinistov in ostalih članov AO, ter za vzgojo in izobraževanje.</li>\r\n</ul>\r\n<p class=\"naslov\">Ustanovitev Alpinističnega odseka Kranj in dosedanji načelniki</p>\r\nUstanovitev AO Kranj sega v čas tik po drugi svetovni vojni. Poleti 1946. leta, so v gorah že dobro prekaljeni mladi fantje <b>Peter Gunčar </b>, <b>Slavko Jenko </b>, <b>Franc Gašperlin </b>, <b>bratje Herlec </b>: Franko, Emil in Roman, Stane Fras in še nekateri, ustanovili Slovensko planinsko društvo \" <b>Gams </b>\".\r\n\r\nOb pomoči starejših planincev in alpinistov Hudovernika, Prinčiča, Lampreta ter pozneje Dovjaka in ostalih, je društvo preraslo v alpinistični odsek. Ustanovni občni zbor AO je bil v zimski sezoni 1946/47 v stari Tekstilni šoli pod pokroviteljstvom tedanjega predsednika PD Kranj g. Črtomira Zorca. Sestanek je uradno vodil g. Klojčnik, sicer pa je bil \"glavni\" Ciril Hudovernik, ki je bil izbran tudi za prvega načelnika.\r\n\r\nNjemu so v naslednjih letih uspešno sledili še:\r\n<ul>\r\n	<li>1948 - <b>Tine Prinčič</b></li>\r\n	<li>1949 - <b>Mirko Brezar</b></li>\r\n	<li>1950 - <b>Darko Bele </b>in <b>Emil Herlec</b></li>\r\n	<li>1951-53 - <b>Slavko Jenko</b></li>\r\n	<li>1954 - <b>Franci Gašperlin</b></li>\r\n	<li>1955-57 - <b>Jože Žvokelj</b></li>\r\n	<li>1958 - <b>Rado Jeranko</b></li>\r\n	<li>1960-62 - <b>Jože Žvokelj</b></li>\r\n	<li>1963 - <b>Franc Ekar</b></li>\r\n	<li>1964 - <b>Brane Jaklič</b></li>\r\n	<li>1965-66 - <b>Jože Žvokelj</b></li>\r\n	<li>1967-68 - <b>Franc Ekar</b></li>\r\n	<li>1969 - <b>Tomaž Jamnik</b></li>\r\n	<li>1970 - <b>Ančka Gornik</b></li>\r\n	<li>1971 - <b>Marjan Ručigaj</b></li>\r\n	<li>1972-73 - <b>Franci Šter</b></li>\r\n	<li>1974-75 - <b>Tone Perčič</b></li>\r\n	<li>1976 - <b>Robert Gabršček</b></li>\r\n	<li>1977-78 - <b>Matjaž Dolenc</b></li>\r\n	<li>1979 - <b>Pavle Oman</b></li>\r\n	<li>1980-81 - <b>Matej Kranjc</b></li>\r\n	<li>1982 - <b>Nejc Zaplotnik</b></li>\r\n	<li>1983 - <b>Janez Triler</b></li>\r\n	<li>1984-87 - <b>Andrej Štremfelj</b></li>\r\n	<li>1988-89 - <b>Tomo Česen</b></li>\r\n	<li>1990-91 - <b>Matej Kranjc</b></li>\r\n	<li>1992-93 - <b>Franci Markič </b>in <b>Janez Triler</b></li>\r\n	<li>1994-95 - <b>Primož Švigelj </b>in <b>Andrej Kecman</b></li>\r\n	<li>1996-97 - <strong>Andrej Prinčič </strong>in<strong> Matej Brajnik</strong></li>\r\n	<li>1998-99 - <strong>Igor Kalan </strong>in<strong> Andrej Kecman</strong></li>\r\n	<li>2000-01 - <strong>Miha Marenče </strong>in<strong> Mišo Dačić</strong></li>\r\n	<li>2002-03 - <strong>Miha Marenče </strong>in<strong> Mišo Dačić</strong></li>\r\n	<li>2004-05 - <strong>Aljoša Brlogar</strong> in <strong>Žiga Šter</strong></li>\r\n	<li>2006-07 - <b>Aljoša Brlogar</b></li>\r\n</ul>','Zgodovina','','publish','closed','closed','','zgodovina','','','2016-03-04 21:03:37','2016-03-04 20:03:37','',20656,'http://aokranj2.lan/?page_id=20660',0,'page','',0);
