INSERT INTO `wp_posts` (`post_author`,`post_date`,`post_date_gmt`,`post_content`,`post_title`,`post_excerpt`,`post_status`,`comment_status`,`ping_status`,`post_password`,`post_name`,`to_ping`,`pinged`,`post_modified`,`post_modified_gmt`,`post_content_filtered`,`post_parent`,`guid`,`menu_order`,`post_type`,`post_mime_type`,`comment_count`) VALUES (1,'2016-03-04 20:34:05','2016-03-04 19:34:05','Od ustanovitve AO do leta 1994 so se kranjski alpinisti s svojimi vzponi vedno znova uveljavljali v samem vrhu slovenskega alpinizma. Zgodovina svetovnega alpinizma je v športnem smislu stara okoli 250 let, slovenskega okoli 200 let, vendar pa je prav zaživel šele v tem stoletju, ko se je z vstopom v himalajsko areno postavil ob bok svetovnemu alpinističnemu vrhu (1975 - Makalu). Prav v tem času šestdesetih, sedemdesetih, osemdesetih in v začetku devetdesetih let so kranjski alpinisti z udeležbo na številnih odpravah, z izjemnimi vzponi doma in tujini, oblikovali zgodovinske dogodke, ki kot križišča tvorijo mrežo naše alpinistične zgodovine. Te svetle točke je v luči vrednotenja potrebno postaviti v čas in razmere kakršne so bile takrat. Svojo vrednost pokažejo v primerijavi z domačimi in tujimi vzponi alpinistov iz drugih krajev naše domovine in tujine.\r\n<h3>Leto 1949</h3>\r\nZimski vzponi:\r\n<ul>\r\n	<li>S greben Kočne, III; M. Murovec, I. Šinkovec</li>\r\n	<li>S raz Travnika: IV, V; E. Herlec, D. Škerlj</li>\r\n	<li>SV stena Malega Jalovca: IV; R. Herlec, B. Popovič</li>\r\n	<li>Brojanov raz v Stenarju: III; C. Debeljak (Ce), J. Frelih (Je), R. Kočevar (Lj), E. Herlec (Kr)</li>\r\n</ul>\r\nLetni vzponi:\r\n<ul>\r\n	<li>S stena Vel. Draškega vrha: III, IV; E. Herlec, I. Kodran</li>\r\n	<li>J stena Kočne: IV; P. Kemperle in tovariši</li>\r\n	<li>Z raz Trentskega Pelca: III; S. Jenko, M. Kraševec</li>\r\n	<li>V raz v S steni Vel. Špičja: IV; S. Jenko, M. Salberger</li>\r\n</ul>\r\n<h3>Leto 1950</h3>\r\nLetni vzponi:\r\n<ul>\r\n	<li>Šite: Kočevar-Herlec: IV, V; R. Kočevar (Lj