INSERT INTO `wp_posts` (`post_author`,`post_date`,`post_date_gmt`,`post_content`,`post_title`,`post_excerpt`,`post_status`,`comment_status`,`ping_status`,`post_password`,`post_name`,`to_ping`,`pinged`,`post_modified`,`post_modified_gmt`,`post_content_filtered`,`post_parent`,`guid`,`menu_order`,`post_type`,`post_mime_type`,`comment_count`) VALUES (1,'2016-03-04 20:37:56','2016-03-04 19:37:56','<h4>Naslov</h4>\r\nAlpinistični odsek Kranj (PD Kranj)\r\nKoroška cesta 27\r\n4000 Kranj\r\nSlovenija\r\n<h4>E-pošta</h4>\r\ninfo@aokranj.com\r\n<h4>Načelnik</h4>\r\nnacelnik@aokranj.com\r\n<h4>Alpinistična šola</h4>\r\nsola.alpinizem@aokranj.com\r\n<h4>Šola športnega plezanja</h4>\r\nsola.plezanje@aokranj.com','Kontakt','','publish','closed','closed','','kontakt','','','2016-03-04 21:04:52','2016-03-04 20:04:52','',0,'http://aokranj2.lan/?page_id=20676',4,'page','',0);
INSERT INTO `wp_posts` (`post_author`,`post_date`,`post_date_gmt`,`post_content`,`post_title`,`post_excerpt`,`post_status`,`comment_status`,`ping_status`,`post_password`,`post_name`,`to_ping`,`pinged`,`post_modified`,`post_modified_gmt`,`post_content_filtered`,`post_parent`,`guid`,`menu_order`,`post_type`,`post_mime_type`,`comment_count`) VALUES (1,'2016-03-04 20:42:33','2016-03-04 19:42:33','<img class=\"alignnone size-full wp-image-20688\" src=\"http://aokranj2.lan/wp-content/uploads/2016/03/plezalna_sola_2015-2016_540.jpg\" alt=\"Šola športnega plezanja\" width=\"540\" height=\"764\" />\r\n\r\n<strong>Jesenska šola športnega plezanja za leto 2015 se začne z uvodnim predavanjem v četrtek, 1. oktobra 2015 ob 18:00, v prostorih AO Kranj (Koroška cesta 27, 4000 Kranj).</strong>\r\n\r\nŠola je primerna za vse, ki ste ste starejši od 16 let in bi radi spoznali osnove športnega plezanja. Skozi zanimiva teoretična predavanja, obiske male in velike umetne stene ter s plezanjem v naravnih plezališčih Slovenije in Istre, se boste naučili varnega in učinkovitega plezanja. Ob koncu pa z uspešno opravljenim izpitom pridobite naziv pripravnik športnega plezanja.\r\n\r\nŠola predvidoma traja 7 - 8 tednov, izvedla pa se bo ob minimalni udeležbi 6 tečajnikov. Zajema naslednje:\r\n\r\n<strong>Teoretične vsebine:</strong>\r\n\r\nUvodno predavanje, vozli, oprema, etika in zgodovina, prva pomoč (teoretično in praktično), trening in prehrana. Predavanja bodo potekala ob četrtkih zvečer. Nekatera se bodo izvedla skupaj z alpinistično šolo.\r\n\r\n<strong>Praktični del:</strong>\r\n\r\nPlezanje na mali in veliki umetni steni (popoldanske/večerne ure med tednom), plezanje v naravnih plezališčih in dvodnevni plezalni izlet (ob vikendih). Zajete bodo naslednje vsebine: vozli, varovanje, tehnike plezanja, spuščanje po vrvi. Ob koncu sledi še praktični izpit za pripravnika športnega plezanja.\r\n\r\nŠola se izvaja pod vodstvom inštruktorjev športnega plezanja. Podroben plan poteka šole bo predstavljen na uvodnem predavanju.\r\n\r\nInformacije in prijave: <a href=\"mailto:sola.plezanje@aokranj.com\">Nastja Vidic</a>','Športno plezanje','','publish','closed','closed','','sportno-plezanje','','','2016-03-04 21:04:44','2016-03-04 20:04:44','',0,'http://aokranj2.lan/?page_id=20682',3,'page','',0);
INSERT INTO `wp_posts` (`post_author`,`post_date`,`post_date_gmt`,`post_content`,`post_title`,`post_excerpt`,`post_status`,`comment_status`,`ping_status`,`post_password`,`post_name`,`to_ping`,`pinged`,`post_modified`,`post_modified_gmt`,`post_content_filtered`,`post_parent`,`guid`,`menu_order`,`post_type`,`post_mime_type`,`comment_count`) VALUES (1,'2016-03-04 20:49:09','2016-03-04 19:49:09','&nbsp;\r\n\r\n<img class=\"wp-image-20687 size-full alignnone\" src=\"http://aokranj2.lan/wp-content/uploads/2016/03/alpinisticna_sola_2015-2016_540.jpg\" alt=\"Alpinistična šola\" width=\"540\" height=\"764\" />\r\n\r\nUvodni sestanek letošnje alpinistične šole bo v <strong>četrtek, 01. oktobra 2015 ob 18:00</strong>, v <a href=\"http://www.geopedia.si/#T105_F450:12246587_x450587_y122386_s17_b4\" target=\"_blank\"><strong>klubskih prostorih AO Kranj, Koroška cesta 27</strong></a> (v kletnih prostorih).\r\n\r\nPogoj za vpis v alpinistično šolo je dopolnjena starost 18 let. Vpišejo se lahko tudi mlajši, vendar morajo biti stari vsaj 15 let, njihovo vpisnico pa bodo morali podpisati starši ali skrbniki kandidata.\r\n\r\nPodrobnejše informacije dobite po elektronski pošti na naslovu: <a href=\"mailto:sola.alpinizem@aokranj.com\">sola.alpinizem@aokranj.com.</a>\r\nOkvirni terminski plan alpinistične šole 2015/2016\r\n<ul>\r\n	<li>1.10.2015 - Uvodni sestanek AS, SP in GS</li>\r\n	<li>8.10.2015 - Vozli</li>\r\n	<li>10.10.2015 - Kondicijska tura</li>\r\n	<li>15.10.2015 - Vozli (prevezovanje, varovanje GriGri)</li>\r\n	<li>22.10.2015 - Oprema 1</li>\r\n	<li>17.10.2015 - Alpinisticni izpiti 2015</li>\r\n	<li>18.10.2015 - AŠ prikaz vrvnih tehnik, gibanje naveze ….</li>\r\n	<li>05.11.2015 - Športno plezanje (praktični prikaz pridobljenega znanja)</li>\r\n	<li>7,8.11.2015 - OSP - skupna tura plezanje dolgih sportno plezalnih smeri</li>\r\n	<li>12.11.2015 - Nevarnosti v Gorah 1</li>\r\n	<li>19.11.2015 - Nevarnosti v gorah 2</li>\r\n	<li>26.11.2015 - Priprava in izvedba plezalnega vzpona</li>\r\n	<li>3.12.2015 - Orientacija</li>\r\n	<li>10.12.2015 - Izrazoslovje</li>\r\n	<li>17.12.2015 - Vremenoslovje</li>\r\n	<li>26.12.2015 - Bozicni vzpon na Triglav</li>\r\n	<li>07.01.2016 - Prva pomoč 1</li>\r\n	<li>14.1.2016 - Prva Pomoč 2</li>\r\n	<li>21.1.2016 - Prva pomoč - praktični del</li>\r\n	<li>28.1.2016 - Zgodovina alpinizma</li>\r\n	<li>4.2.2016 - Poznavanje gorstev</li>\r\n	<li>11.2.2016 - Bivakiranje in taborjenje</li>\r\n	<li>18.2.2016 - Turna smuka</li>\r\n	<li>25.2.2016 - GRS</li>\r\n	<li>3.3.2016 - Trening</li>\r\n	<li>10.3.2016 - Prehrana</li>\r\n	<li>17.3.2016 - Ledeniki</li>\r\n	<li>24.3.2016 - Odpravarstvo</li>\r\n	<li>31.3.2016 - Fotografija(reševanje padlega)?</li>\r\n	<li>7.4.2016 - Predavanje po željah tečajnikov</li>\r\n</ul>\r\n<strong>Vsa predavanja so ob četrtkih popoldan (18.30).</strong>\r\n\r\n<strong>Navedeni so le tečaji in plezalni dnevi, ki so obvezni za vse, plezalnih vikendov bo organiziranih več in se določijo sproti glede na vreme.</strong>\r\n\r\n<strong>Plan šole je okviren in se glede na vremenske razmere lahko spremeni.</strong>\r\n\r\nAlpinistično šolo vodi alpinistični inštruktor <a href=\"mailto:mtj.kastelic@gmail.com\"><strong>Matej Kastelic</strong></a> ob pomoči alpinista <a href=\"mailto:jelic.klemen@gmail.com\"><strong>Klemna Jeliča</strong></a>.','Alpinizem','','publish','closed','closed','','alpinizem','','','2016-03-04 21:04:02','2016-03-04 20:04:02','',0,'http://aokranj2.lan/?page_id=20685',2,'page','',0);
INSERT INTO `wp_posts` (`post_author`,`post_date`,`post_date_gmt`,`post_content`,`post_title`,`post_excerpt`,`post_status`,`comment_status`,`ping_status`,`post_password`,`post_name`,`to_ping`,`pinged`,`post_modified`,`post_modified_gmt`,`post_content_filtered`,`post_parent`,`guid`,`menu_order`,`post_type`,`post_mime_type`,`comment_count`) VALUES (1,'2016-03-04 21:25:59','2016-03-04 20:25:59','<h2>Športno plezanje za otroke od 6. do 15. leta starosti</h2>\r\nČe imajo vaši otroci preveč energije in radi plezajo po vsem kar vidijo, so organizirani treningi športnega plezanja pri AO Kranj kot naročeni za vas. Prijazni in izkušeni trenerji bodo poskrbeli, da bodo njihove plezalne vragolije potekale na varen način, poleg tega pa bodo vodeno, tudi skozi igro, spoznali šport, ki zaradi svoje vsestranskosti postaja vedno bolj priljubljen.\r\n<h3>Prijave</h3>\r\nPrijave pošljite na elektronski naslov <a href=\"mailto:treningi@aokranj.com\" target=\"_blank\">treningi@aokranj.com</a>. V prijavi <span style=\"color: red;\"><strong>nujno navedite </strong></span>naslednje podatke:\r\n<ul>\r\n	<li>polno ime otroka</li>\r\n	<li>naslov stalnega prebivališča</li>\r\n	<li>datum rojstva</li>\r\n	<li>morebitne plezalne izkušnje (število mesecev/let redne vadbe in/ali občasna srečanja s plezanjem)</li>\r\n	<li>kontaktna telefonska številka vsaj enega od staršev</li>\r\n</ul>\r\nPS: Za zelo verjetno doživljensko zasvojenost s plezanjem ne odgovarjamo!\r\n<h4>Članstvo v PD Kranj</h4>\r\nPogoj za obiskovanje treningov je urejeno članstvo v naši krovni organizaciji, to je <a href=\"http://www.pdkranj.si/\">Planinsko Društvo Kranj</a>. Članstvo vašega otroka v PD Kranj mora biti urejeno za vsako tekoče koledarsko leto.\r\n\r\nZa prvo včlanitev je potrebno izpolniti in podpisati pristopno izjavo, obrazec katere lahko pridobite na <a href=\"http://pdkranj.si/clanarina/\">tem naslovu</a>. Izjavo natisnete, izpolnete s podatki vašega otroka ter podpisano prinesete na prvi trening. Znesek za članarino bo dodan prvemu izdanemu računu.\r\n<h3>Splošne informacije</h3>\r\n<h4>Kje, kdaj, kolikokrat, kako?</h4>\r\nTreningi potekajo 1-krat ali 2-krat tedensko na umetni plezalni steni v stavbi pokritega olimpijskega bazena v Kranju, v popoldanskem času. Za začetnike priporočamo obiske treningov 1x ali maksimalno 2x tedensko. Preskok med 1x in 2x se lahko izvede kadarkoli, najbolje pa je, da se o tem dogovorite s trenerjem skupine, v kateri vaš otrok trenira. Otrokov trener zagotovo najbolje pozna njegove plezalne sposobnosti in zato zna oceniti, kdaj je najprimernejši trenutek za stopnjevanje treninga.\r\n<h4>Starostna omejitev</h4>\r\nNajmanjša predvidena starost otroka je dopolnjenih 6 let v tekočem šolskem letu. Starejšim od 15 let pa že bolj priporočamo udeležbo na šoli športnega plezanja, ki je namenjena izobrazbi za bolj samostojno udejstvovanje. Več o šoli športnega plezanja si lahko preberete, če kliknete na povezavo \"Šola športnega plezanja\" v meniju na desni.\r\n<h4>Trajanje treningov</h4>\r\nTreningi športnega plezanja se izvajajo med šolskim letom. Datum začeteka rednih treningov je odvisen od posameznega trenerja in njegove skupine. Lahko se začne že v septembru, najkasneje pa v začetku oktobra.\r\n\r\nV vsakem primeru vas bo o začetku rednih treningov pravočasno obvestil vaš trener.\r\n\r\nTreningi ponavadi trajajo do konca šolskega leta, vendar je lahko dogovor v posamezni skupini drugačen (zaključek konec maja ipd).\r\n\r\nTudi če smo trenutno že sredi šolskega leta in se je vašemu otroku zahotelo preizkusiti v plezanju, nas nemudoma kontaktirajte. Uredili bomo vsaj poizkusni obisk. Od zapolnjenosti skupin pa je odvisna možnost takojšnjega vpisa v redno vadbo.\r\n<h4>Tedenski termini</h4>\r\nTe informacije vam bo pred začetkom rednih treningov posredoval(a) vaš(a) trener(ka). V kolikor se zgodi, da vam termin res ne ustreza, nemudoma kontaktirajte vašega trenerja in skupaj boste našli ustrezen nadomestni termin (in s tem drugo skupino).\r\n<h4>Oprema</h4>\r\nZa prvih nekaj treningov bodo dovolj že samo navadni šolski copati, vendar je za dober razvoj gibalnih sposobnosti vitalnega pomena, da ima otrok osnovno opremo, ki se potrebuje pri treningih športnega plezanja:\r\n<ul>\r\n	<li>plezalniki (čevlji za plezanje)</li>\r\n	<li>vrečka za magnezij</li>\r\n	<li>magnezij</li>\r\n</ul>\r\n<strong><span style=\"color: #ff0000;\">POZOR:</span></strong> Pred nakupom se nujno posvetujte s trenerjem vašega otroka. Z nasveti, ki temeljijo na preteklih izkušnjah, vam bo pomagal pri izbiri primerne opreme.\r\n<h4>Športnoplezalni tabori za otroke</h4>\r\nVsak konec leta organiziramo vsaj en športnoplezalni tabor. Za točne informacije o taborih povprašajte trenerja vašega otroka.\r\n<h4>Ste prebrali vse do tu?</h4>\r\nPotemtakem je pa skrajni čas, da tega vašega talentiranca pripeljete naokrog... :)','Športno plezanje za otroke','','publish','closed','closed','','sportno-plezanje-za-otroke','','','2016-03-04 21:25:59','2016-03-04 20:25:59','',20682,'http://aokranj2.lan/?page_id=20696',0,'page','',0);
INSERT INTO `wp_posts` (`post_author`,`post_date`,`post_date_gmt`,`post_content`,`post_title`,`post_excerpt`,`post_status`,`comment_status`,`ping_status`,`post_password`,`post_name`,`to_ping`,`pinged`,`post_modified`,`post_modified_gmt`,`post_content_filtered`,`post_parent`,`guid`,`menu_order`,`post_type`,`post_mime_type`,`comment_count`) VALUES (1,'2016-03-04 21:26:51','2016-03-04 20:26:51','Zahodna liga je namenjena mladim plezalcem, ki šele vstopajo v svet tekmovanj in si s svojo udeležbo naberejo prvih izkušenj. Za tekmovalce z licenco je tekmovanje uvod v pomladanski pričetek državnega prvenstva. Za vse pa priložnost, da se po mrtvi zimski sezoni zopet srečujejo s svojimi \"plezalskimi\" kolegi in sklepajo nova znanstva, v sproščujočem in zabavnem okolju.\r\n\r\n<img class=\"size-full wp-image-20704 alignnone\" src=\"http://aokranj2.lan/wp-content/uploads/2016/03/zahodna_liga.jpg\" alt=\"Zahodna liga - Športno plezanje\" width=\"500\" height=\"168\" />\r\n\r\nPlezanje poteka na \"flash\" kar pomeni, da vsi tekmovalci spremljajo napredovanje tekmovalca v smeri in z varovanjem od zgoraj. Postavljalci smeri se praviloma odločajo za lažje smeri, kot smo jih vajeni iz državnega prvenstva.\r\n\r\n&nbsp;\r\n<h4>Tekmuje se v naslednjih kategorijah:</h4>\r\n<table border=\"0\" cellspacing=\"1\" cellpadding=\"1\">\r\n<tbody>\r\n<tr>\r\n<td>Kategorija</td>\r\n<td>Letnik</td>\r\n</tr>\r\n<tr>\r\n<td>Mlajše cicibanke, cicibani</td>\r\n<td>2007 in mlajši</td>\r\n</tr>\r\n<tr>\r\n<td>Starejše cicibanke, cicibani</td>\r\n<td>2005 - 2006</td>\r\n</tr>\r\n<tr>\r\n<td>Mlajše deklice in mlajši dečki</td>\r\n<td>2003 - 2004</td>\r\n</tr>\r\n<tr>\r\n<td>Starejše deklice in starejši dečki</td>\r\n<td>2001 - 2002</td>\r\n</tr>\r\n<tr>\r\n<td>Kadetinje in kadeti</td>\r\n<td>1999 - 2000</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n&nbsp;\r\n<h3>Koledar tekem za leto 2016:</h3>\r\n<table border=\"0\" cellspacing=\"1\" cellpadding=\"1\">\r\n<tbody>\r\n<tr>\r\n<td>27.02.2016</td>\r\n<td colspan=\"4\">ŠPO JESENICE - Jesenice - hitrost</td>\r\n</tr>\r\n<tr>\r\n<td>Sobota</td>\r\n<td><a href=\"http://www.aokranj.com/zahodna-liga/dokumenti/Razpis_ZL2016_Jesenice.pdf\" target=\"_blank\">Razpis</a></td>\r\n<td><a href=\"http://www.aokranj.com/zahodna-liga/dokumenti/ZL_2016_hitrost_Jesenice_prijave.pdf\" target=\"_blank\">Prijave</a></td>\r\n<td><a href=\"http://www.aokranj.com/zahodna-liga/dokumenti/Rezultati_ZL_Jesenice_2016.pdf\" target=\"_blank\">Rezultati</a></td>\r\n<td>Fotogalerija</td>\r\n</tr>\r\n<tr>\r\n<td>12.03.2016</td>\r\n<td colspan=\"4\">ŠPO RADOVLJICA - Radovljica - balvani</td>\r\n</tr>\r\n<tr>\r\n<td>Sobota</td>\r\n<td><a href=\"http://www.aokranj.com/zahodna-liga/dokumenti/Razpis_ZL2016_Radovljica.pdf\" target=\"_blank\">Razpis</a></td>\r\n<td>Prijave</td>\r\n<td>Rezultati</td>\r\n<td>Fotogalerija</td>\r\n</tr>\r\n<tr>\r\n<td>02.04.2016</td>\r\n<td colspan=\"4\">PK KAMNIK - balvani</td>\r\n</tr>\r\n<tr>\r\n<td>Sobota</td>\r\n<td>Razpis</td>\r\n<td>Prijave</td>\r\n<td>Rezultati</td>\r\n<td>Fotogalerija</td>\r\n</tr>\r\n<tr>\r\n<td>23.04.2016</td>\r\n<td colspan=\"4\">DRPK - Ljubljana - težavnost</td>\r\n</tr>\r\n<tr>\r\n<td>Sobota</td>\r\n<td>Razpis</td>\r\n<td>Prijave</td>\r\n<td>Rezultati</td>\r\n<td>Fotogalerija</td>\r\n</tr>\r\n<tr>\r\n<td>14.05.2016</td>\r\n<td colspan=\"4\">AO KRANJ - Šenčur - težavnost</td>\r\n</tr>\r\n<tr>\r\n<td>Sobota</td>\r\n<td>Razpis</td>\r\n<td>Prijave</td>\r\n<td>Rezultati</td>\r\n<td>Fotogalerija</td>\r\n</tr>\r\n<tr>\r\n<td colspan=\"3\">Pozor! Zadnji popravek 22.01.2016.</td>\r\n<td colspan=\"2\">Skupni rezultati</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n&nbsp;\r\n\r\n<img class=\"alignleft size-full wp-image-20705\" src=\"http://aokranj2.lan/wp-content/uploads/2016/03/zlpokoncna.jpg\" alt=\"Zahodna liga\" width=\"150\" height=\"325\" />\r\n\r\n<a href=\"http://www.aokranj.com/zahodna-liga/dokumenti/Vabilo_klubom_ZL_2016.pdf\" target=\"_blank\">Vabilo klubom</a>\r\n<a href=\"http://www.aokranj.com/zahodna-liga/dokumenti/prijava-zl2015.xls\" target=\"_blank\">Obrazec za prijavo</a>\r\n<a href=\"http://www.aokranj.com/zahodna-liga/dokumenti/Pravilnik_zahodne_lige_2016.pdf\" target=\"_blank\">Pravilnik</a>\r\n____________________________\r\n<strong>Koordinator Zahodne lige 2016:</strong>\r\nJernej Jazbec, AO Kranj\r\nGSM: 064 117299\r\n<a href=\"mailto:zahodna.liga@aokranj.com\">zahodna.liga@aokranj.com</a>\r\n\r\n<img class=\"alignleft size-full wp-image-20706\" src=\"http://aokranj2.lan/wp-content/uploads/2016/03/zlviseca.jpg\" alt=\"Zahodna liga\" width=\"150\" height=\"194\" />','Zahodna liga 2016','','publish','closed','closed','','zahodna-liga-2016','','','2016-03-04 21:47:47','2016-03-04 20:47:47','',20682,'http://aokranj2.lan/?page_id=20698',0,'page','',0);
INSERT INTO `wp_posts` (`post_author`,`post_date`,`post_date_gmt`,`post_content`,`post_title`,`post_excerpt`,`post_status`,`comment_status`,`ping_status`,`post_password`,`post_name`,`to_ping`,`pinged`,`post_modified`,`post_modified_gmt`,`post_content_filtered`,`post_parent`,`guid`,`menu_order`,`post_type`,`post_mime_type`,`comment_count`) VALUES (1,'2016-03-04 21:59:53','2016-03-04 20:59:53','AO Kranj skrbi za opremljanje in vzdrževanje smeri v plezališču Preddvor, kjer se nahajajo smeri vseh težavnostnih stopenj, od 4a do 8a+. Najprimernejši čas plezanja je od zgodne pomladi do pozne jeseni.\r\n<h2>Dostop</h2>\r\nPreddvor leži ob cesti Kranj-Jezersko. V centru Preddvora zavijte v Novo vas. Peljete naravnost po asfaltni cesti in ko se asfalt konča, parkirate avto in se peš odpravite po zgornji (levi) makadamski cesti. Vožnja po gozdni poti do plezališča je prepovedana! Po 15 minutah hoje boste levo nad potjo zagledali med drevje skrito plezališče.\r\n<h2>Smeri - sektor A/I</h2>\r\n<table>\r\n<tbody>\r\n<tr>\r\n<th>št.</th>\r\n<th><b>ime smeri</b></th>\r\n<th><b>težavnost</b></th>\r\n<th><b>višina</b></th>\r\n</tr>\r\n<tr>\r\n<td>1</td>\r\n<td>Tinkara</td>\r\n<td>4c</td>\r\n<td>15 m</td>\r\n</tr>\r\n<tr>\r\n<td>2</td>\r\n<td>Rožle</td>\r\n<td>6b</td>\r\n<td>15 m</td>\r\n</tr>\r\n<tr>\r\n<td>3</td>\r\n<td>Brincelj</td>\r\n<td>5c</td>\r\n<td>8 m</td>\r\n</tr>\r\n<tr>\r\n<td>4</td>\r\n<td>Pehta</td>\r\n<td>5b</td>\r\n<td>20 m</td>\r\n</tr>\r\n<tr>\r\n<td>5</td>\r\n<td>Sedma božja zapoved</td>\r\n<td>6a</td>\r\n<td>17 m</td>\r\n</tr>\r\n<tr>\r\n<td>6</td>\r\n<td>Martinček</td>\r\n<td>6c+</td>\r\n<td>15 m</td>\r\n</tr>\r\n<tr>\r\n<td>7</td>\r\n<td>Srečno Kekec</td>\r\n<td>6c</td>\r\n<td>20 m</td>\r\n</tr>\r\n<tr>\r\n<td>8</td>\r\n<td>Lukec in njegov škorec</td>\r\n<td>6c+</td>\r\n<td>20 m</td>\r\n</tr>\r\n<tr>\r\n<td>9</td>\r\n<td>Čivava</td>\r\n<td>7b+</td>\r\n<td>17 m</td>\r\n</tr>\r\n<tr>\r\n<td>10</td>\r\n<td>Sonček je</td>\r\n<td>4a</td>\r\n<td>19 m</td>\r\n</tr>\r\n