INSERT INTO `wp_posts` (`post_author`,`post_date`,`post_date_gmt`,`post_content`,`post_title`,`post_excerpt`,`post_status`,`comment_status`,`ping_status`,`post_password`,`post_name`,`to_ping`,`pinged`,`post_modified`,`post_modified_gmt`,`post_content_filtered`,`post_parent`,`guid`,`menu_order`,`post_type`,`post_mime_type`,`comment_count`) VALUES (1,'2016-03-04 22:07:07','2016-03-04 21:07:07','Urnik zasedenosti plezalne stene na podstrešju pokritega Olimpijskega bazena ter velike stene v športni dvorani Osnovne šole Šencur.\r\n<ul>\r\n<li><a href=\"#bazen-spredaj\">Plezalna stena na bazenu - sprednji del</a></li>\r\n<li><a href=\"#bazen-zadaj\">Plezalna stena na bazenu - zadnji del</a></li>\r\n<li><a href=\"#sencur\">Plezalna stena v Osnovni šoli Šenčur</a></li>\r\n</ul>\r\n<strong>OPOZORILO: Plezanje je možno le s potrjeno izkaznico za uporabo plezalne stene. Izkaznico lahko potrdite vsak četrtek ob 20h na sestanku odseka.</strong>\r\n\r\nDODATNO OBVESTILO: Anžetovi treningi ob sredah (od 19h do 20h) v večini primerov zaradi reprezentančnih treningov odpadejo. V primeru odpadlega reprezentantčnega treninga temu seveda ni tako. Zato naj velja, da je termin načeloma prost, v izjemnih (nepredvidljivih) primerih pa bo zaseden.\r\n\r\n<a name=\"bazen-spredaj\"></a>\r\n<h2>Plezalna stena na bazenu - sprednji del</h2>\r\n\r\n[iframe width=\"535\" height=\"500\" frameborder=\"0\" scrolling=\"no\" src=\"https://www.google.com/calendar/embed?showTitle=0&amp;showNav=0&amp;showDate=0&amp;showTabs=0&amp;showCalendars=0&amp;showTz=0&amp;mode=WEEK&amp;height=500&amp;wkst=2&amp;hl=sl&amp;bgcolor=%23FFFFFF&amp;src=qotr3vi9djs96017uplsfrs44o%40group.calendar.google.com&amp;color=%23853104&amp;ctz=Europe%2FBelgrade\"]\r\n\r\n<a name=\"bazen-zadaj\"></a>\r\n<h2>Plezalna stena na bazenu - zadnji del</h2>\r\n\r\n[iframe width=\"535\" height=\"500\" frameborder=\"0\" scrolling=\"no\" src=\"https://calendar.google.com/calendar/embed?showTitle=0&amp;showNav=0&amp;showDate=0&amp;showPrint=0&amp;showTabs=0&amp;showCalendars=0&amp;showTz=0&amp;mode=WEEK&amp;height=500&amp;wkst=2&amp;bgcolor=%23FFFFFF&amp;src=tt9esk1ljsmkfgkjfierauq75g%40group.calendar.google.com&amp;color=%23AB8B00&amp;ctz=Europe%2FBelgrade\"]\r\n\r\n<a name=\"sencur\"></a>\r\n<h2>Plezalna stena v Osnovni šoli Šenčur</h2>\r\n\r\n[iframe width=\"535\" height=\"800\" frameborder=\"0\" scrolling=\"no\" src=\"https://calendar.google.com/calendar/embed?showTitle=0&amp;showNav=0&amp;showDate=0&amp;showPrint=0&amp;showTabs=0&amp;showCalendars=0&amp;showTz=0&amp;mode=WEEK&amp;height=500&amp;wkst=2&amp;bgcolor=%23FFFFFF&amp;src=ie7kd3s90k98vqnqu9bh11niq0%40group.calendar.google.com&amp;color=%231B887A&amp;ctz=Europe%2FBelgrade\"]','Umetne stene - urnik','','publish','closed','closed','','umetne-stene-urnik','','','2016-03-04 22:07:07','2016-03-04 21:07:07','',0,'http://aokranj2.lan/?page_id=20714',0,'page','',0);
